      "description": "<p>Más pantalla, más espacio para jugar</p><p>Expandí tu vista con el Infinity-V Display de 6.5” de Galaxy A12 y no te pierdas ningún detalle. Gracias a la tecnología HD+, tus contenidos lucirán más nítidos y claros.</p><br><p>Se ve tan bien como se siente</p><p>Capturá momentos memorables con detalles más nítidos con una cámara principal de 48MP. Ampliá el ángulo de visión con la cámara Ultra Gran Angular. Personalizá el enfoque con la cámara de profundidad o acercate más a los detalles con la cámara macro.</p><br><p>Cámara ultra gran angular, ultra grandes momentos</p><p>De forma similar al ojo humano, los 5 MP de la cámara ultra gran angular capturan el mundo en un ángulo visual de 123 grados, añadiendo mayor perspectiva a todo lo que fotografiás.</p><br><p>Cámara macro para capturar los pequeños detalles</p><p>Acercate con la cámara macro de 2 MP y descubrí los detalles que podrías estarte perdiendo. Aplicá un efecto Bokeh a tus fotos para hacer destacar al sujeto sobre el fondo.</p><br><p>Cámara frontal para selfies impresionantes</p><p>Con la cámara frontal de 8 MP y Live Focus es muy fácil capturar selfies asombrosas que destacan tu rostro sobre el fondo.</p><br><p>Poder para seguir en movimiento</p><p>Prepará tu día con una batería que no se detiene. Con 5,000 mAh* podés seguir con tus actividades durante horas y horas; además, con hasta 15 W de carga rápida adaptativa, Galaxy A12 recupera rápidamente su máxima potencia.</p><br><p>Más espacio para jugar</p><p>El Galaxy A12 combina la potencia de un procesamiento de ocho núcleos con hasta 4 GB de RAM, para un rendimiento rápido y eficiente. Además, disfrutá de 128 GB de almacenamiento interno.</p><br><br><p>¿Hacemos factura A? Para que podamos emitir la factura A, necesitamos que la cuenta desde donde vayas a realizar la compra, esté registrada como IVA Responsable Inscripto o IVA Exento. De lo contrario, se va a emitir automáticamente una factura B.</p><br>",
