      "description": "<p>Pantalla asombrosa para un desplazamiento verdaderamente fluido</p><p>Ampliá tu visión con la pantalla Infinity-U de 6,4\" del Galaxy A22 y mirá todo lo que te estabas perdiendo. Gracias a la pantalla Super Amoled HD+ que alcanza los 600 nits1 para lograr más claridad, tus contenidos se ven nítidos, definidos y deslumbrantes. Además, Real Smooth mantiene el desplazamiento fluido en tus juegos y redes sociales.</p><br><p>Capturá los detalles incluso con poca luz gracias a OIS</p><p>Olvidate de las fotos y videos borrosos gracias a la cámara principal de 48MP con OIS. La estabilización óptica de imagen (Optical Image Stabilization, OIS) te ayuda a tomar videos más fluidos y nítidos y a captar más luz para iluminar las tomas con poca luz.</p><br><p>Tomá la foto completa con la cámara ultraancha</p><p>Similar a la vista humana, la cámara ultraancha de 8MP muestra el mundo con un ángulo de visión de 123 grados para ampliar la perspectiva de todas tus fotos.</p><br><p>La cámara macro pone atención a los detalles más pequeños</p><p>Acercate con la cámara macro de 2MP y sacá a relucir hasta los más mínimos detalles de tus fotos. Le aplica un efecto bokeh natural a tus fotos, permitiendo que el sujeto resalte del fondo de la foto.</p><br><p>Llevá el centro de atención al primer plano con la cámara de profundidad</p><p>La cámara de profundidad de 2MP te permite ajustar la profundidad de campo en tus fotos. Con un simple toque, podés ajustar fácilmente el desenfoque de fondo detrás del sujeto y obtener retratos de alta calidad que se llevarán toda la atención.</p><br><p>Compartí las mejores selfies con la cámara frontal</p><p>Con la cámara frontal de 13MP y el efecto bokeh, podés sacar selfies deslumbrantes y ser el centro de atención.</p><br><p>Seguí con una batería potente</p><p>Anticipate al día con una batería que no te ralentizará. La batería de 5000 mAh (típica) ¹ te permite seguir haciendo lo que haces durante horas y horas. Y con hasta 15 W de carga rápida adaptativa, el Galaxy A22 vuelve rápidamente a su máxima potencia.</p><br><p>Mayor velocidad, mayor almacenamiento</p><p>El Galaxy A22 combina la potencia de su procesador Octa-core con la memoria RAM de hasta 4GB para obtener un rendimiento más rápido y eficiente. Disfrutá el almacenamiento interno de 128GB y agregale hasta 1TB más con una tarjeta MicroSD.</p><br><p>Concentrate más con One UI Core</p><p>One UI Core te ayuda a concentrarte en lo que más te importa. El hardware y el software trabajan en conjunto para poner los contenidos y funciones al alcance de tus dedos y que puedas acceder a ellos más rápido. Cambiá de una aplicación a otra fácilmente y recibí información de varias aplicaciones al mismo tiempo. Su diseño cómodo te permite realizar varias tareas en una sola pantalla.</p><br><p>Una experiencia Android™ asombrosa, siempre</p><p>Conseguí las últimas aplicaciones de Google con el SO de Android, totalmente compatibles con tu Galaxy A22.</p><br><br><p>¿Hacen factura A?</p><p>Para que podamos emitir la factura A, necesitamos que la cuenta de Mercado Libre desde donde vayas a realizar la compra, esté registrada como IVA Responsable Inscripto o IVA Exento. De lo contrario, se va a emitir automáticamente una factura B.</p><p>Podrás actualizar esta información desde la sección \"Mis datos\".</p><br>",
